contributors:
  data_collectors:
  - last_name: unknown
    given_name: unknown
    ORCID: unknown
    affiliation: Australian PlantBank, The Royal Botanic Gardens & Domain Trust, Mount
      Annan, NSW
  dataset_curators: Elizabeth Wenk
dataset:
  data_is_long_format: no
  custom_R_code: '
    data %>%
      mutate(
        measurement_remarks = paste0("Collector: ", Collector),
        location_name = ifelse(!is.na(`Adjusted Germination`) & !is.na(`Scientific Name`),
        paste0("seeds_collected_at_",`Decimal Latitude`,"_lat_and_",`Decimal Longitude`,"_long"), NA),
        location_name = ifelse(location_name == "seeds_collected_at_NA_lat_and_NA_long", "seeds_collection_location_unknown", location_name)
      ) %>%
      filter(!is.na(`Scientific Name`))'
  collection_date: Collection Date
  taxon_name: Scientific Name
  location_name: location_name
  description: Seed trait data from the Australian PlantBank, The Royal Botanic Gardens
    & Domain Trust, Mount Annan, NSW, including seed mass of collected seeds and data
    on germination trials.
  basis_of_record: captive_cultivated
  life_stage: adult
  measurement_remarks: measurement_remarks
  sampling_strategy: The Australian PlantBank was built in NSW in 2013. It is an international centre for plant research and learning, incorporating the largest native plant conservation seedbank in Australia. Like the National Herbarium of NSW, the Australian PlantBank forms a living reference collection for identification, research and restoration. Visitors can immerse themselves in the workings of our scientists by seeing into the laboratories aided by award-winning interpretation. As well as storing millions of seeds, PlantBank staff contribute to the conservation, research and restoration of threatened species and plant communities through our partnerships in Australia and overseas.
  original_file: Data downloaded from https://seedbank.ala.org.au on 19 Feb 2025.
    Data downloaded by Order, for all vascular plants.
  notes: none
identifiers:
- var_in: Accession Number
  identifier_type: catalogNumber
